const Container = styled.div`
	margin: 3rem auto;
`;
const MovieItem = styled.div`
	cursor: pointer;
	margin: 1rem;
	box-shadow: 0 0 4px #eee;
`;
const Title = styled.div``;
const Price = styled.div``;

export { Container, MovieItem, Title, Price };
